import React from 'react'
import { signWithGoogle } from './Firebase';
import './App.css';

import { useEffect } from 'react'
import { gapi } from 'gapi-script'

const clientId = '39221243254-ef0fio7fuc5g939rfq67a0cqu05q1lfm.apps.googleusercontent.com'

function App() {

  useEffect(() => {
    function start() {
      gapi.client.init({
        clientId: clientId,
        scope: ''
      })
    }
    gapi.load('client:auth2', start)
  })


  return (
    <div className="App container">
      <button className='login-with-google-btn' onClick={signWithGoogle}>Sign in with Google</button>
    </div>
  );
}

export default App;
